INSERT INTO `wp_options` VALUES (175,'elementor_remote_info_feed_data','a:3:{i:0;a:5:{s:5:\"title\";s:101:\"Introducing Elementor 3.27: Flexible Grids, Better Security, Enhanced Accessibility & More Creativity\";s:7:\"excerpt\";s:409:\"Elementor 3.27 is packed with features designed to give you more control, boost your sites performance, enhance accessibility, and take your creativity to new heights. This version is all about solving real challengeswhether its designing intricate Grid layouts, embedding modern video formats, or adding effortless animations, Elementor 3.27 makes your workflow smoother and your websites smarter.\r\n\";s:7:\"created\";i:1738142681;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:155:\"https://elementor.com/blog/elementor-327-grid-layouts-local-google-fonts-ai-motion/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:62:\"Introducing Hello Biz: A New Beginner Friendly WordPress Theme\";s:7:\"excerpt\";s:226:\"The first in a new collection of beginner-friendly Hello Themes, Hello Biz aims to make building Professional websites easier. Designed to streamline website creation, by helping you build a polished, high-performance website.\";s:7:\"created\";i:1736335773;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:121:\"https://elementor.com/blog/introducing-hello-biz/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:65:\"Introducing Elementor 3.26: Dynamic Design & Enhanced Performance\";s:7:\"excerpt\";s:192:\"Boost your sites speed and performance with optimized CSS and a cleaner DOM, create dynamic content with an Off-Canvas modal from Loop Grids, and leverage the new AdBlock detection trigger.\";s:7:\"created\";i:1736174778;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:146:\"https://elementor.com/blog/elementor-326-off-canvas-loop-grid-performance/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}','off');
